// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "./VaultBase.sol";
import "../../interfaces/IUniswapV2Router02.sol";


pragma experimental ABIEncoderV2;

/**
* @title Corn Finance Stop Loss Vault
* @author C.W.B.
*/
contract StopLossVault is VaultBase {
    constructor(
        address _controller, 
        uint256 _maxTokens, 
        string memory _name, 
        string memory _symbol, 
        string memory _URI
    ) public VaultBase(_controller, _maxTokens, _name, _symbol, _URI) {}

    // --------------------------------------------------------------------------------

    /**
    * @dev This contract is owned by the Controller. Call 'createTrade' from the Controller
    * to use this function.
    * @notice The number of sell prices determines how many orders to create. The amount 
    * in for the sell orders is the total amount deposited divided by the number of sell 
    * prices. Each sell order will have the same amount in.
    * Example:
    *     - amount in: 100 USDC
    *     - to token: WMATIC
    *     - sell price 1: 0.9 WMATIC / 1 USDC
    *     - sell price 2: 0.7 WMATIC / 1 USDC
    *     - sell price 3: 0.5 WMATIC / 1 USDC
    *     - sell price 4: 0.4 WMATIC / 1 USDC
    *
    *     * amount out = amount in / sell price *
    *
    *     Sell order 1: 25 USDC --> 27.77 WMATIC
    *     Sell order 2: 25 USDC --> 35.71 WMATIC
    *     Sell order 3: 25 USDC --> 50 WMATIC
    *     Sell order 4: 25 USDC --> 62.5 WMATIC
    * @param _from: Controller contract will forward 'msg.sender'
    * @param _tokens:
    *   [0] = from token 
    *   [1] = to token
    * @param _amounts: 
    *   [0] = {required} starting amount
    *   [1] = {required} stop loss price (1) (token[0] / token[1]) * PRICE_MULTIPLIER()
    *   [2] = {optional} stop loss price (2) (token[0] / token[1]) * PRICE_MULTIPLIER()
    *   [3] = {optional} stop loss price (3) (token[0] / token[1]) * PRICE_MULTIPLIER()
    *   [4] = {optional} stop loss price (4) (token[0] / token[1]) * PRICE_MULTIPLIER()
    * @param _times:
    *   [0] = Expiration time in Unix. Orders will not be filled after this time.
    * @return Order IDs of the created orders. Stop Loss vault creates all orders
    * at the time of creating the trade. Number of order IDs returned is the
    * number of stop loss prices inputted.
    */
    function createTrade(address _from, address[] memory _tokens, uint256[] memory _amounts, uint[] memory _times) public onlyOwner returns (uint256[] memory) {
        // Only one expiration time allowed
        require(_times.length == 1);

        // Trade consists of only two tokens
        require(_tokens.length == 2);

        // Limit stop loss orders to 4. Deposit amount occupies the first element.
        require(_amounts.length >= 2 && _amounts.length <= 5, "CornFi Stop Loss Vault: Invalid Amounts Length");

        // Create the trade
        uint256 amountInWithFee = _createTrade(_from, _tokens, _amounts, _times);

        // Calculate the amount in for the orders
        uint256 orderAmountIn = amountInWithFee.div(_amounts.length.sub(1));

        // Order IDs of the created orders
        uint256[] memory orderIds = new uint256[](_amounts.length.sub(1));

        // Avoid stack too deep error
        uint256[] memory amounts = _amounts;
        address[] memory tokens = _tokens;

        // Create all of the stop loss orders
        for(uint i = 1; i < amounts.length; i++) {
            orderIds[i-1] = _createOrder(tokenCounter.sub(1), 0, [tokens[0], tokens[1]], [orderAmountIn, 0, _getAmountOut(tokens[0], tokens[1], orderAmountIn, amounts[i])], _times);
        }

        // Return the order IDs of the created orders
        return orderIds;
    }

    // --------------------------------------------------------------------------------

    /**
    * @dev This contract is owned by the Controller. Call 'fillOrder' from the Controller
    * to use this function.
    * @param _from: Controller contract will forward 'msg.sender'
    * @param _orderId: Order to fill
    * @param _router: Router used to perform the swap (i.e. fill the order)
    * @param _path: Path used to perform the swap
    * @return Since Stop Loss vault does not create any new orders after filling orders,
    * '[]' is returned.
    */
    function fillOrder(address _from, uint256 _orderId, IUniswapV2Router02 _router, address[] memory _path) public onlyOwner returns (Order memory) {
        Order memory order = orders[_orderId];

        // // Withdraw tokens from holding strategy
        // strategy(order.tokens[0]).withdraw(address(this), order.tokens[0], order.amounts[0]);

        // Fill order
        ( , uint256 amountOut) = _swap(_from, order, _router, _path);

        // Ensure the order is executed only when the current price falls below the stop price
        require(amountOut <= order.amounts[2], "CornFi Stop-Loss Vault: Current Price Too High");

        // IStrategy strat = strategy(order.tokens[1]);

        // // Transaction fees
        // uint256 txFee = strat.txFee(amountOut);
        // if(txFee > 0) {
        //     IERC20(order.tokens[1]).safeTransfer(controller.Fees(), txFee);
        // }

        // // Adjust user balance
        // orders[_orderId].amounts[1] = amountOut.sub(txFee);

        // // Deposit swapped tokens into respective holding strategy
        // IERC20(order.tokens[1]).approve(address(strat), orders[order.orderId].amounts[1]);
        // strat.deposit(address(this), order.tokens[1], orders[order.orderId].amounts[1]);

        // // Close order, remove from open orders list
        // _closeOrderHelper(_orderId);
    }

    // --------------------------------------------------------------------------------

    /**
    * @dev This contract is owned by the Controller. Call 'withdraw' from the Controller
    * to use this function.
    * @notice After calling this function, all orders associated with '_tokenId' are
    * closed and their tokens are returned to the token owner. The token is then
    * burnt and cannot be used again.
    * @param _from: Controller contract will forward 'msg.sender'
    * @param _tokenId: Vault token to withdraw
    */
    function withdraw(address _from, uint256 _tokenId) public onlyOwner {
        _withdraw(_from, _tokenId);
    }
}
